import random
import requests
import binascii
from time import perf_counter
import os
def test_latency(num_requests, url_link):
    avg_latency = 0
    # image_hex = []
    # file_name = 'images/cat.jpeg'
    # with open(file_name, 'rb') as f:
    #     content = f.read()
    # image_hex.append(binascii.hexlify(content))

    image_hex = [""]

    # print(image_hex)
    for _ in range(num_requests):
        image_index = 0
        # random.randint(100)
        # 'img': 
        image_object = image_hex[image_index]
        start = perf_counter()
        query = f"curl -X POST {url_link} -d {image_object}"
        os.system(query)
        end = perf_counter()

        avg_latency += (end - start)
    avg_latency /= num_requests
    return avg_latency

